import { BrowserRouter as Router } from 'react-router-dom';
import store from './redux';
import Application from './app';
import './styles/global.scss';

ReactDOM.render(
  // <React.StrictMode>
    <Provider store={store}>
      <Router basename={basename}>
        <Application />
      </Router>
    </Provider>
 //  </React.StrictMode>
 ,
  document.getElementById('app')
);

